import React from 'react';
import { View, StyleSheet, FlatList, Dimensions, Text } from 'react-native';
import { SvgXml } from 'react-native-svg'; // Import SvgXml for SVG rendering

// SVG data for offers
const Offer50OffSvg = `<svg width="200" height="130" viewBox="0 0 222 131" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect width="200" height="130" fill="url(#pattern0_237_1565)"/>
<defs>
<pattern id="pattern0_237_1565" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_237_1565" transform="matrix(0.00197355 0 0 0.00334448 -0.00226732 0)"/>
</pattern>
<image id="image0_237_1565" width="509" height="299" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
`; // Replace with actual SVG data
const Offer25OffSvg = `<svg width="200" height="130" viewBox="0 0 135 131" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect width="200" height="130" fill="url(#pattern0_237_1566)"/>
<defs>
<pattern id="pattern0_237_1566" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_237_1566" transform="matrix(0.00196464 0 0 0.00335938 0 -0.00222709)"/>
</pattern>
<image id="image0_237_1566" width="509" height="299" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
`; // Replace with actual SVG data

const { width } = Dimensions.get('window');

// Update these paths and filenames
const Offers = [
  {
    id: 1,
    image: <SvgXml xml={Offer50OffSvg} width="100%" height="100%" />, // Use SVG component
  },
  {
    id: 2,
    image: <SvgXml xml={Offer25OffSvg} width="100%" height="100%" />, // Use SVG component
  },
  // Add more offers as needed
];

const Item = ({ image, isFirst }) => (
  <View style={[styles.item, isFirst && styles.firstItem]}>
    {React.cloneElement(image, { width: '100%', height: '100%' })} 
  </View>
);

const OfferCarousel = () => {
  const renderItem = ({ item, index }) => (
    <Item image={item.image} isFirst={index === 0} />
  );

  if (Offers.length === 0) {
    return (
      <View style={styles.container}>
        <Text>No offers available</Text>
      </View>
    );
  }

  return (
    <View style={styles.container}>
      <FlatList
        data={Offers}
        renderItem={renderItem}
        keyExtractor={item => item.id.toString()}
        horizontal
        showsHorizontalScrollIndicator={false}
        contentContainerStyle={styles.listContent}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    width: '100%',
    height: 180, // Adjusted height to match the image
  },
  listContent: {
    paddingHorizontal: 15, // Added horizontal padding
  },
  item: {
    marginLeft: -95, // Decreased margin to bring images closer together
    width: width * 0.85, // Adjusted width to show part of next item
    height: 180, // Adjusted height
    justifyContent: 'center',
    alignItems: 'center',
    borderRadius: 10, // Rounded corners
    overflow: 'hidden', // Ensure image respects border radius
    marginLeft: 15,
  },
  firstItem: {
    marginLeft: 0, // Adjust this value to move the first image to the left
  },
  secondItem: {
    marginLeft: 0, // Adjust this value to move the second image to the left
  },
  
});

export default OfferCarousel;